import React from "react";
import './App.css';
import MyNavbar from "./components/Navbar";
import MyHeader from "./components/Header";
import Wrapper from "./components/Wrapper";

function App() {
  return (
    <Wrapper>
      <MyNavbar/>
      <MyHeader/>
    </Wrapper>
  );
}

export default App;
